import React from 'react'
import 'bootstrap/dist/css/bootstrap.css';
import { NavLink } from 'react-router-dom';
// import { Route } from 'react-router-dom';
// import {NavLink} from "react-router-dom";
// import Home from './Home';
// import About from './About';
// import Contact from './Contact';

const Navbar = () => {
  return (
    <>
<nav class="navbar navbar-expand-lg bg-body-tertiary">
  <div class="container-fluid">
    <NavLink class="navbar-brand" h="/">Navbar</NavLink>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <ul class="navbar-nav ms-auto">
        <li class="nav-item">
          <NavLink className="nav-link active" aria-current="page" href="/home">Home</NavLink>
        </li>
        <li class="nav-item">
          <NavLink className="nav-link" href="/about">About</NavLink>
        </li>

        <li class="nav-item">
          <NavLink className="nav-link" href="/contact">Contact</NavLink>
        </li>

        <li class="nav-item">
          <NavLink className="nav-link" href="/login">Login</NavLink>
        </li>

        <li class="nav-item">
          <NavLink className="nav-link" href="/signup">Register</NavLink>
        </li>
      </ul>
    </div>
  </div>
</nav>
    </>
  )
}

export default Navbar
